import React from 'react';
import AddText from "./AddText";
import MyButton from "../../UI/button/MyButton";

function ShowTextList () {
    let bodyText="";
    return (
        <div>
            <span>{bodyText}</span>
            <MyButton onClick={()=> bodyText=AddText}>
                GeT Posts
            </MyButton>
        </div>
    );
}

export default ShowTextList;
